import React from "react";

export const TrackSearchResult = ({track}) => {

    return (
        <div 
             className="d-flex m-2 align-items-center">
            <img 
            src={track.albumUrl}
            style={{ height: "64px", width:"64px" }} 
            alt="spotify music search"/>
            <div>{track.title}</div>
            <div className="text-muted">{track.artist}</div>
        </div>
    )
}
